typedef Solution Foo;

class LeetCode : public ::testing::Test
{
 public:
  void SetUp() {}

 protected:
  Foo foo;
  const int loopNum = 1e0;
};

TEST_F(LeetCode, test1)
{
  vector<vector<int> > grid = {{3, 2, 1}, {1, 7, 6}, {2, 7, 7}};
  for (int i = 0; i < loopNum; i++) EXPECT_EQ(foo.equalPairs(grid), 1);
}

TEST_F(LeetCode, test2)
{
  vector<vector<int> > grid = {
      {3, 1, 2, 2},
      {1, 4, 4, 5},
      {2, 4, 2, 2},
      {2, 4, 2, 2},
  };
  for (int i = 0; i < loopNum; i++) EXPECT_EQ(foo.equalPairs(grid), 3);
}
